  return (
    <>
      <AppLayout>
        <Head>
          <title>회원가입 | sns</title>
        </Head>
        <Form onFinish={onSubmit}>
          <div>
            <label>아이디</label>
            <br />
            <Input name='user-id'></Input>
          </div>
        </Form>
      </AppLayout>
    </>
  );
};

signup.propTypes = {};

export default signup;
